INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-04', '2017-01-03', 'Principal', 'NOTIFIQUESE PERSONALMENTE A LA PARTE PROMOVENTE  ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=1&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=03/01/2017&listaFPublicacion=04/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-09', '2017-01-06', 'Principal', 'Agréguese el oficio de cuenta signado por el Magistrado designado para cubrir la guardia relativa al segundo período vacacional del año dos mil dieciséis del Tribunal de lo Contencioso Administrativo de la Ciudad de México, mediante el cual informa que el referido tribunal, se encuentra en su segundo período vacacional, de lo que se toma conocimiento.NOTIFÍQUESE. ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=2&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=06/01/2017&listaFPublicacion=09/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-10', '2017-01-09', 'Principal', 'Vistas las constancias que integran los presentes autos, así como la certificación secretarial que antecede, de las que se advierte que ha transcurrido el plazo de veinticuatro horas que le fue otorgado al Coordinador de Verificación y Reglamentos en Iztapalapa; sin embargo, ha sido omiso en atender el requerimiento del tres de los cursantes. En consecuencia, requiérase nuevamente a la citada autoridad para que dentro del plazo de VEINTICUATRO HORAS, remita copia certificada y legible de las constancias relativas al expediente administrativo CVR/VV/OB/0034/2016... se le apercibe.NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=3&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=09/01/2017&listaFPublicacion=10/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-12', '2017-01-11', 'Principal', 'Agréguese el escrito de cuenta signado por la quejosa. Ahora bien, se admite a trámite la demanda de amparo.Como lo solicitó la parte promovente, tramítese por duplicado y separado el incidente de suspensión de los actos reclamados.Dese la intervención que legalmente corresponde a la Agente del Ministerio Público de la Federación adscrita a este juzgado.Por otra parte, requiérase a las autoridades responsables, rindan su informe justificado, se les apercibe.Al respecto, se fijan las NUEVE HORAS CON CUARENTA MINUTOS DEL SIETE DE FEBRERO DE DOS MIL DIECISIETE, para que tenga verificativo la audiencia constitucional.Por otra parte, ténganse como pruebas de su parte las documentales que acompañó a su escrito inicial.Por otra parte, líbrese atento oficio al Coordinador de Verificación y Reglamentos en Iztapalapa y al Magistrado Presidente de la Segunda Sala del Tribunal de lo Contencioso Administrativo de la Ciudad de México, para que dentro del plazo de tres días, remitan a este Juzgado de Distrito copia certificada y legible de las constancias relativas al expediente administrativo CVR/VV/OB/0034/2016 y al juicio de nulidad II-55404/2016, respectivamente... se le apercibe.NOTIFÍQUESE. ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=4&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=11/01/2017&listaFPublicacion=12/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-12', '2017-01-11', 'Incidental', 'Vista la cuenta que antecede, como está ordenado en el cuaderno principal,  fórmese y tramítese por duplicado el incidente de suspensión de los actos reclamados, requiérase a las autoridades responsables su informe previo, Al respecto, se fijan las NUEVE HORAS CON TREINTA Y UN MINUTOS DEL DIECIOCHO DE ENERO DE DOS MIL DIECISIETE, para la celebración de la audiencia incidental.Por otra parte, se niega la suspensión provisional solicitada, tengase como pruebas las que indica. NOTIFIQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=5&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=11/01/2017&listaFPublicacion=12/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-16', '2017-01-13', 'Principal', 'Agréguese el oficio de cuenta, signado por el Coordinador de Verificación y Reglamentos en Iztapalapa, exhibe copia certificada de las constancias que integran el expediente administrativo CVR/VV/OB/0034/2016.Por lo anterior, con su contenido dese vista a las partes para que manifiesten lo que a su interés legal convenga y tómese en consideración en el momento procesal oportuno.De igual forma, intégrese el oficio signado por la Secretaria de Acuerdos de la Segunda Sala del Tribunal de lo Contencioso Administrativo de la Ciudad de México, mediante el cual, manifiesta su imposibilidad para remitir copia certificada del juicio de nulidad II-55404/2016 de su índice, de lo que este juzgado toma conocimiento.En ese sentido, líbrese atento oficio al Secretaría General de Acuerdos del Tribunal Contencioso Administrativo de la Ciudad de México, para que dentro del plazo de tres días, remita a este Juzgado de Distrito copia certificada y legible de las constancias que integren el juicio de nulidad II-55404/2016 del índice del Segunda Sala del Tribunal de lo Contencioso Administrativo de la Ciudad de México. se le apercibe.NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=6&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=13/01/2017&listaFPublicacion=16/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-18', '2017-01-17', 'Principal', 'Autoridad oficiante devuelve los oficios 1177/2017 y 1197/2017, por la razón que se esgrime... Al respecto, no es el caso de requerir a la parte quejosa para exponga lo que a su derecho convenga en relación con la inexistencia de la autoridad aludida, toda vez que mediante proveído del tres de enero pasado  este órgano jurisdiccional la requirió para que proporcionara datos suficientes que permitieran su identificación y emplazamiento el cual fue desahogado... Finalmente, con copia autorizada del presente auto y del oficio que se acuerda, dese cuenta en los cuadernos incidentales relativos al presente juicio... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=7&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=17/01/2017&listaFPublicacion=18/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-18', '2017-01-17', 'Incidental', 'Autoridad responsable rinde su respectivo informe previo en términos de lo que establece el artículo 140 de la Ley de Amparo. Con su contenido dese vista a las partes para que manifiesten lo que a su interés legal convenga y tómese en consideración en el momento procesal oportuno. Ahora bien,  se tienen como delegados de la autoridad responsable a las personas que designa y como domicilio para oír y recibir notificaciones el que refiere.Por otra parte, glósese la copia autorizada del proveído de esta misma fecha, así como del oficio de cuenta, por medio del cual la autoridad oficiante devuelve el oficio 1197/2017 del índice de este juzgado, por los motivos que indica. Al respecto, no es el caso de requerir a la parte quejosa para exponga lo que a su derecho convenga en relación con la inexistencia de la autoridad aludida... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=8&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=17/01/2017&listaFPublicacion=18/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2020-02-25', '2017-01-18', 'Incidental', 'SE RESUELVE: Único.- Se niega la suspensión definitiva a . NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=9&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=18/01/2017&listaFPublicacion=19/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-23', '2017-01-20', 'Principal', 'Autoridad oficiante remite copia certificada de las constancias que integran el juicio de nulidad, del índice de la Segunda Sala del Tribunal de lo Contencioso Administrativo de la Ciudad de mÉXICO, en tal virtud se deja sin efectos el apercibimiento decretado en autos. Por lo anterior, con su contenido dese vista a las partes para que manifiesten lo que a su interés legal convenga y tómese en consideración en el momento procesal oportuno.NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=10&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=20/01/2017&listaFPublicacion=23/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-24', '2017-01-23', 'Principal', 'Parte quejosa realiza diversas manifestaciones; al respecto, ténganse por hechas las mismas en vía de alegatos, sin perjuicio de tomarlos en consideración en el momento procesal oportuno. Asimismo, le autoriza a la parte quejosa, el uso de medios electrónicos para obtener reproducción de las constancias que obren en este expediente... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=11&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=23/01/2017&listaFPublicacion=24/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-01-24', '2017-01-23', 'Incidental', 'Vistos los escritos de cuenta signados por la parte quejosa, 4en atención a ello, se le autoriza, el uso de medios electrónicos para obtener reproducción de las constancias que obren en este expediente, dejando para tal efecto la razón correspondiente... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=12&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=23/01/2017&listaFPublicacion=24/01/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-02-01', '2017-01-31', 'Principal', 'Autoridad responsable rinde su informe justificado en términos de lo que establece el artículo 117 de la Ley de Amparo; con su contenido dese vista a las partes para que manifiesten lo que a su interés legal convenga y tómese en consideración en el momento procesal oportuno. Por otra parte, se tienen como delegados de su parte a las personas que señala y como domicilio para oír y recibir notificaciones, el que indica en el oficio que se provee. Asimismo, téngase como pruebas de la autoridad de mérito las señaladas... Finalmente, en atención a sus manifestaciones; no ha lugar a acordar de conformidad... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=13&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=31/01/2017&listaFPublicacion=01/02/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-02-08', '2017-02-07', 'Principal', 'SENTENCIA: ÚNICO.- SE SOBRESEE EN EL PRESENTE JUICIO DE AMPARO... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=16&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=07/02/2017&listaFPublicacion=08/02/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-02-09', '2017-02-08', 'Incidental', 'Parte quejosa interpone recurso de revisión contra la resolución interlocutoria emitida en el presente incidente, en atención a ello, tramítese el mismo, agréguese una copia del escrito de expresión de agravios a este expediente, así como al duplicado respectivo, distribúyanse las otras entre las partes, y una vez que obre en autos la totalidad de las constancias de tal distribución, remítase el presente expediente a la Superioridad... NOTIFÍQUESE.  ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=14&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=08/02/2017&listaFPublicacion=09/02/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-02-21', '2017-02-20', 'Incidental', 'Tribunal Colegiado en Materia Administrativa del Primer Circuito, acusa recibo del diverso oficio 24-III, del índice de este juzgado, así como el original y copia del escrito de expresión de agravios. De igual modo, informa que se registró el recurso de revisión interpuesto en el presente asunto por la parte quejosa, con el número de toca R.A. 66/2017 de su índice; de lo que este Juzgado toma conocimiento.Por otra parte, envíese el acuerdo recurrido vía correo electrónico a la dirección referida. NOTIFÍQUESE. ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=17&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=20/02/2017&listaFPublicacion=21/02/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-03-02', '2017-03-01', 'Principal', 'Se declara que la sentencia en la que se decretó el sobreseimiento en el presente juicio de amparo; HA CAUSADO EJECUTORIA. En ese sentido, atento a la certificación secretarial que antecede, una vez que el Sexto Tribunal Colegiado en Materia Administrativa del Primer Circuito devuelva los autos originales del incidente de suspensión relativo al juicio de amparo en que se actúa, se acordará lo conducente respecto del archivo; comuníquese esta determinación al Sexto Tribunal Colegiado en Materia Administrativa del Primer Circuito, para lo que tenga a bien determinar respecto del recurso de revisión R.A. 66/2017 (INC) de su índice.NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=18&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=01/03/2017&listaFPublicacion=02/03/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-03-08', '2017-03-07', 'Incidental', 'Sexto Tribunal Colegiado en Materia Administrativa del Primer Circuito,  informa la determinación contenida en auto del tres de marzo de dos mil diecisiete, dictada en el recurso de revisión R.A. 66/2017 de su índice, por el que en atención al diverso oficio 7202/2017 del índice de este Juzgado de Distrito, dejó sin materia el citado medio de impugnación, por los motivos que indica. NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=19&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=07/03/2017&listaFPublicacion=08/03/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-03-24', '2017-03-23', 'Incidental', 'Sexto Tribunal Colegiado en Materia Administrativa del Primer Circuito, devuelve los autos originales del cuaderno incidental derivado del juicio de amparo en que se actúa; al respecto, acúsese de recibo. Finalmente, se ordena glosar las actuaciones originales que obren en el cuaderno duplicado, al cuaderno de suspensión original... NOTIFÍQUESE.', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=20&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=23/03/2017&listaFPublicacion=24/03/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-03-30', '2017-03-29', 'Principal', 'Vistas las constancias que integran los presentes autos, de la que se advierte  que este Juzgado reservó  acordar lo conducente  en relación con el archivo  del presente asunto.  En atención a ello, archívese el presente expediente y cúmplase con lo ordenado del acuerdo general conjunto 1/2009 del pleno de la corte y del consejo... Asimismo, devuélvase a la parte quejosa, las documentales que exhibió en el presente juicio, en la inteligencia de las que obran agregadas en original, se ponen a su disposición por el término de 90 días. Bajo apercibimiento... NOTIFÍQUESE; Y PERSONALMENTE A LA PARTE QUEJOSA.  ', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=21&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=29/03/2017&listaFPublicacion=30/03/2017');
INSERT INTO `acuerdos_juicios_federales` VALUES (68, '2017-04-04', '2017-03-29', 'Principal', 'POR NO HABER ACUDIDO A NOTIFICARSE A ESTE ÓRGANO JURISDICCIONAL DENTRO DE LOS DOS DÍAS HÁBILES SIGUIENTES AL EN QUE SE FIJÓ EL AVISO EN LA PUERTA DEL INMUEBLE VISITADO, SE NOTIFICA POR LISTA A LA PARTE QUEJOSA, EL PROVEÍDO DEL VEINTINUEVE DE MARZO DE DOS MIL DIECISIETE', 'https://www.dgepj.cjf.gob.mx/siseinternet/Actuaria/VerAcuerdo.aspx?listaAcOrd=22&listaCatOrg=10&listaNeun=20204745&listaAsuId=1&listaExped=1/2017&listaFAuto=29/03/2017&listaFPublicacion=04/04/2017');
